import ExpenseItem from "./ExpenseItem";


const ExpenseItems = (props) => {
    return (props.expenses.map((expense) => (
        <ExpenseItem
          key={expense.id}
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      )));
}

export default ExpenseItems;
